      <section style={{height: "100%"}}>
        <div className="background-image">
          <div className="message-border">
            <span className="message">
              G12 Transport works locally to transport loads throughout the state of California.
              We are a privately owned trucking company based in Los Angeles, California.
              Our company is composed of owner-operators: self-employed commercial truck drivers that operate trucks for transporting goods over highways for its clients. 
            </span>
          </div>
        </div>
        <div className="testing">

        </div>
      </section>
    );
  }
}

